            headers: {
                'content-type': 'application/json',
                'X-RapidAPI-Key': '8d95881717mshb150bac71409acbp1dbee3jsn2097310c3b61',
                'X-RapidAPI-Host': 'symptom-checker4.p.rapidapi.com'
            }
        })
            .then(res => {
                setSymptom(res.data)
                console.log(res.data);
            })
            .catch(err => {
                console.log(err);
            })
    }, [])
    return (
